import React from 'react';
import './App.css';

function App() {

  const handleData = () => {
    fetch("https://covid19.mathdro.id/api/countries/[country]/confirmed")
    .then(res => {
      return res.json().then(res => {
        const countryName = res.map(country => {
          return country.countryRegion
        })
        const confirmed = res.map(country => {
          return country.confirmed
